const MemberContext = React.createContext ();
//Provider
//Consumer

class MemberProvider extends Component {

	render() {

    return (


      <MemberContext.Provider value="context">
      	{this.props.children}
      </MemberContext.Provider>
    )


  }
  }

const MemberConsumer = MemberConsumer.Consumer;

